// ... (other imports)

function HomePage({ onLogin }) {
    const [error, setError] = useState('');
    const api_url = 'http://localhost:3004';
    const navigate = useNavigate();
  
    const getBannersShopsloca = async () => {
      try {
        const response = await axios.get(`${api_url}/banners`);
        if (response.status === 200) {
          const { token } = response.data;
          localStorage.setItem('jwtToken', token);
  
          onLogin();
          navigate('/samsung');
        } else {
          setError('Login failed');
        }
      } catch (error) {
        setError('Login failed');
      }
    };
  
    const handleImageClick = () => {
      console.log('Image Clicked'); // Add this log
      getBannersShopsloca();
    };
  
    // ... (other parts of the component)
  
    return (
      <div className="d-flex flex-column justify-content-between" style={{ minHeight: '100vh' }}>
        {/* ... (other JSX) */}
  
        {/* First Row */}
        <Row className="justify-content-center">
          <Col xs={6} md={6} className="text-center">
            <img
              onClick={handleImageClick}
              id="imagemod"
              src="https://img.global.news.samsung.com/th/wp-content/uploads/2023/02/Galaxy-S23-Series_KV_Product_2p_LI-1024x724.jpg"
              alt="Slot 1"
              className="img-fluid"
              data-value="SamSungS23"
            />
          </Col>
          <Col xs={6} md={6} className="text-center">
            {/* ... (other JSX) */}
          </Col>
        </Row>
  
        {/* ... (other JSX) */}
      </div>
    );
  }
  
  export default HomePage;
